  selector: 'storybook-page',
  template: `<article>
    <storybook-header
      [user]="user"
      (onLogout)="onLogout.emit($event)"
      (onLogin)="onLogin.emit($event)"
      (onCreateAccount)="onCreateAccount.emit($event)"
